Using the ecosystem is simple, but requires learning what to do. You'll need to also know how to use is_tested (attribute), please, read that chapter before continuing. Okay! I'll assume that you already know how to use the is_tested attribute, because you read the is_tested chapter. The most innovative concept in this binary is the use of shebangs (#!). Yes, it turns out that Rust accepts shebangs as a valid token, even with not much functionality. So, we can use a shebang at the start of a file to declare which lints we want ( also possible with the CLI ). #! is-tested You'll write this in the first line of a file to enable testing, the binary will parse this later, and will not cause an error. Now, you can apply any lint you want, and each item will be subject to your linting. To skip an item from linting, you can use the is_not_tested attribute. It has its own chapter . Example I want to check that all my functions are checked, except my function main. #! is-tested functions use is_tested::is_tested;
use is_not_tested::is_not_tested; #[is_not_tested(reason = "It's the main function, duuuh")] // Reasons are optional!
fn main() { // [...]
} #[is_tested("tests/a_function.rs")]
fn a_function() { // [...]
} // No testing here, Oh no!
fn another_function() { // [...]
} The code above will cause an error, a 🌌 pretty error 🌟 , to be specific, because you specified (with that functions lint) that all functions must be tested. There are lints for a lot of other items (check cargo is-tested --help), like structs, traits, macros...
